        public ReportService(AppDBContext context, EventTypeService eventTypeService)
        {
            _context = context;
            _eventTypeService = eventTypeService;
        }

        public async Task<string> GetProgram(Guid eventId)
        {
            var @event = await _context.BaseEvents.FindAsync(eventId);

            _context.Entry(@event).State = EntityState.Detached;

            return @event.Plan;
        }

        public async Task<string> GetBudgetForm(Guid eventId)
        {
            var @event = await _context.BaseEvents.FindAsync(eventId);
            var guestCount = await _context.Guests.Where(g => g.Event.Id == eventId).CountAsync();
            var suppliers = await _context.Suppliers
                .Include(s => s.Type)
                .Where(s => s.Event.Id == eventId)
                .ToListAsync();

            string html = @"
<!DOCTYPE html>
<html>
    <head>
        <title>Budget Form</title>
        <style>" + css + @"</style>
    </head>
    <body>
        <table id='suppliers'>
            <thead>
                <tr class='logo'>
                    <td colspan='11'>
                        <img class='logo' src='{0}'/>
                    </td>
                </tr>
                <tr>
                    <td colspan='11' class='header'>{1}</td>
                </tr>
                <tr>
                    <th>Supplier</th>
                    <th>Company</th>
                    <th>Contact Person</th>
                    <th>Package Price</th>
                    <th>Discount</th>
                    <th>1st Down Payment</th>
                    <th>2nd Down Payment</th>
                    <th>3rd Down Payment</th>
                    <th>Total Down</th>
                    <th>Balance</th>
                    <th>Remarks</th>
                </tr>
            </thead>
            <tbody>
                {2}
            </tbody>
            <tfoot>
                {3}
                <tr>
                    <td colspan='4'>
                        <p>____________</p>
                        <p>Copyright Events Finest by Dhon Conwi Events</p>
                    </td>
                </tr>
            </tfoot>
        </table>
    </body>
</html>
";
            string header = "";
            string footer = "";
            StringBuilder strBuilder = new StringBuilder();
            string imgSrc = "data:image/png;base64,";

            var wedTypeId = await _eventTypeService.GetWeddingEventTypeId();
            string celebrant = "";
            if (@event.Type.Id == wedTypeId)
            {
                var wedEv = @event as Wedding;
                celebrant = wedEv.BrideName + " - " + wedEv.GroomName;
            }
            else
            {
                var ev = @event as Event;
                celebrant = ev.Celebrant;
            }

            strBuilder.Append($"<strong>Celebrant/s:</strong> {celebrant} ");
            strBuilder.Append($"<strong>Date:</strong> {@event.Date.Value.ToLongDateString()} ");
            strBuilder.Append($"<strong>Guest#:</strong> {guestCount} ");

            header = strBuilder.ToString();
            strBuilder.Clear();

            IList<string> contents = new List<string>();

            foreach (var s in suppliers)
            {
                strBuilder = new StringBuilder();
                strBuilder.Append("<tr>");
                strBuilder.Append($"<td>{s.Type.Name}</td>");
                strBuilder.Append($"<td>{s.Name}</td>");
                strBuilder.Append($"<td>{s.ContactPerson}</td>");
                strBuilder.Append($"<td>{s.PackagePrice.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.Discount.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.FirstDownPayment.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.SecondDownPayment.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.ThirdDownPayment.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.TotalDown.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.Balance.ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
                strBuilder.Append($"<td>{s.Remarks}</td>");
                strBuilder.Append("</tr>");

                contents.Add(strBuilder.ToString());
            }

            strBuilder.Clear();
            strBuilder.Append("<tr>");
            strBuilder.Append($"<td>Total</td>");
            strBuilder.Append($"<td></td>");
            strBuilder.Append($"<td></td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.PackagePrice).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.Discount).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.FirstDownPayment).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.SecondDownPayment).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.ThirdDownPayment).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.TotalDown).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.Balance).ToString("C2", CultureInfo.GetCultureInfo("en-PH"))}</td>");
            strBuilder.Append($"<td></td>");
            strBuilder.Append("</tr>");
            footer = strBuilder.ToString();

            var fullHtml = string.Format(html, imgSrc, header, string.Join(' ', contents), footer);

            return PreMailer.Net.PreMailer.MoveCssInline(fullHtml).Html;
        }

        public async Task<string> GetChecklist(Guid eventId)
        {
            var @event = await _context.BaseEvents.Include(e => e.Type).FirstAsync(e => e.Id == eventId);
            var suppliers = await _context.Suppliers
                .Include(s => s.Type)
                .Where(s => s.Event.Id == eventId)
                .ToListAsync();

            string html = @"
<!DOCTYPE html>
<html>
<head>
    <title>Checklist</title>
    <style>" + css + @"</style>
</head>
<body onload='window.print()'>
    <table id='checklist'>
        <thead>
            <tr class='logo'>
                <td colspan='4'>
                    <img class='logo' src='{0}'/>
                </td>
            </tr>
            <tr>
                <td colspan='4'>
                    <h2 class='title'>WEDDINGS & MOTIFS EVENT CHECK LIST</h2>
                </td>
            </tr>
        </thead>
        <tbody>
            {1}
        </tbody>
        <tfoot>
            <tr>
                <td colspan='4'>
                    <p>____________</p>
                    <p>Copyright Events Finest by Dhon Conwi Events</p>
                </td>
            </tr>
        </tfoot>
    </table>
</body>
</html>
";
            IList<string> contents = new List<string>();
            StringBuilder strBuilder = new StringBuilder();
            string imgSrc = "data:image/png;base64,";

            var wedTypeId = await _eventTypeService.GetWeddingEventTypeId();
            string celebrant = "";
            if (@event.Type.Id == wedTypeId)
            {
                var wedEv = @event as Wedding;
                celebrant = wedEv.BrideName + " - " + wedEv.GroomName;
            }
            else
            {
                var ev = @event as Event;
                celebrant = ev.Celebrant;
            }

            strBuilder.Append("<tr>");
            strBuilder.Append("<td>");
            strBuilder.Append("<strong>Name of Celebrant/s</strong>");
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append(celebrant);
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append($"<strong>Event Date:</strong> {@event.Date.Value.ToLongDateString()}");
            strBuilder.Append("</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            strBuilder.Append("<tr>");
            strBuilder.Append("<td>");
            strBuilder.Append("<strong>Type of Event</strong>");
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append(@event.Type.Name);
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append($"<strong>Package:</strong> {@event.Package.Name}");
            strBuilder.Append("</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            foreach (var s in suppliers)
            {
                strBuilder.Append("<tr>");
                strBuilder.Append("<td>");
                strBuilder.Append($"<strong>{s.Type.Name}</strong>");
                strBuilder.Append("</td>");
                strBuilder.Append("<td>");
                strBuilder.Append($"Supplier: {s.Name}");
                strBuilder.Append("</td>");
                strBuilder.Append("<td>");
                strBuilder.Append($"<strong>Contact Person:</strong> {s.ContactPerson}");
                strBuilder.Append($"<br/><strong>Mobile no.:</strong> {s.Mobile}");
                strBuilder.Append($"<br/><strong>Email Add:</strong> {s.Email}");
                strBuilder.Append("</td>");
                strBuilder.Append("</tr>");

                contents.Add(strBuilder.ToString());
                strBuilder.Clear();
            }

            var fullHtml = string.Format(html, imgSrc, string.Join(' ', contents));

            return PreMailer.Net.PreMailer.MoveCssInline(fullHtml).Html;
        }

        public async Task<string> GetGuestList(Guid eventId)
        {
            var @event = await _context.BaseEvents
                .Include(e => e.Type)
                .Include(e => e.Guests)
                .FirstAsync(e => e.Id == eventId);

            string html = @"
<!DOCTYPE html>
<html>
<head>
    <title>Checklist</title>
    <style>" + css + @"</style>
</head>
<body onload='window.print()'>
    <table id='guest-list'>
        <thead>
            <tr>
                <th colspan='3'><img class='logo' src='{0}' /></th>
            </tr>
            <tr>
                <th colspan='3'><h2 class='title'>WEDDINGS & MOTIFS EVENT GUEST LIST</h2></th>
            </tr>
        </thead>
        <tfoot>
            <tr>
                <td colspan='3'>
                    <p>____________</p>
                    <p>Copyright Events Finest by Dhon Conwi Events</p>
                </td>
            </tr>
        </tfoot>
        <tbody>
            {1}
        </tbody>
    </table>
</body>
</html>
";
            IList<string> contents = new List<string>();
            StringBuilder strBuilder = new StringBuilder();
            string imgSrc = "data:image/png;base64,";

            var wedTypeId = await _eventTypeService.GetWeddingEventTypeId();
            string celebrant = "";
            if (@event.Type.Id == wedTypeId)
            {
                var wedEv = @event as Wedding;
                celebrant = wedEv.BrideName + " - " + wedEv.GroomName;
            }
            else
            {
                var ev = @event as Event;
                celebrant = ev.Celebrant;
            }

            strBuilder.Append("<tr>");
            strBuilder.Append($"<td colspan='2'><strong>Name of Celebrant/s: </strong>{celebrant}</td>");
            strBuilder.Append($"<td><strong>Event Date:</strong> {@event.Date.Value.ToLongDateString()}</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            strBuilder.Append("<tr>");
            strBuilder.Append($"<td colspan='2'><strong>Type of Event: </strong>{@event.Type.Name}</td>");
            strBuilder.Append($"<td><strong>Package:</strong> {@event.Package.Name}</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            contents.Add("<tr><td colspan='3'>Guests</td></tr>");
            contents.Add("<tr style='background-color: black; color: white'>");
            contents.Add("<td>Name</td>");
            contents.Add("<td>Table #S</td>");
            contents.Add("<td>Remarks</td>");
            contents.Add("</tr>");

            foreach (var g in @event.Guests.Where(g => g.WillAttend.HasValue && g.WillAttend.Value))
            {
                strBuilder.Append("<tr>");
                strBuilder.Append($"<td>{g.LastName}, {g.Name}</td>");
                strBuilder.Append($"<td>{g.Table}</td>");
                strBuilder.Append($"<td>{g.Remarks}</td>");
                strBuilder.Append("</tr>");

                contents.Add(strBuilder.ToString());
                strBuilder.Clear();
            }

            var fullHtml = string.Format(html, imgSrc, string.Join(' ', contents));

            return PreMailer.Net.PreMailer.MoveCssInline(fullHtml).Html;
        }
    }
}
